import React from 'react'
import { useParams } from 'react-router-dom';
const Error = () => {
    const { errorType } = useParams();
  return (
    <>
     <h2>Error Type: {errorType}</h2>
    <div>Not Found</div>
    </>
  )
}

export default Error
